<html lang="pt-br">

    <style>
      :root {
        --primary-color: #4f0072;
        --accent-color: #fb0a5e;
        --background-color: #ffffff;
        --form-bg-color: #f9f9f9;
        --text-color: #333333;
        --border-color: #e0e0e0;
        --text-color-light: #ffffff;
        --sombra: 0 4px 12px rgba(79, 0, 114, 0.15);
        --transicao: all 0.3s ease;
        --gradient-primary: linear-gradient(
          135deg,
          var(--primary-color) 0%,
          #7b1fa2 100%
        );
        --gradient-accent: linear-gradient(
          135deg,
          var(--accent-color) 0%,
          #ff6b9d 100%
        );
        --glass-bg: rgba(255, 255, 255, 0.95);
        --glass-border: rgba(255, 255, 255, 0.2);
      }

      * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
      }

      body {
        font-family: "Inter", -apple-system, BlinkMacSystemFont, "Segoe UI",
          Roboto, sans-serif;
        background: linear-gradient(
          135deg,
          #f8fafc 0%,
          #e2e8f0 50%,
          #f1f5f9 100%
        );
        min-height: 100vh;
        position: relative;
        overflow-x: hidden;
      }

      /* Animated background elements */
      .bg-shapes {
        position: fixed;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        pointer-events: none;
        z-index: 1;
      }

      .shape {
        position: absolute;
        border-radius: 50%;
        background: var(--gradient-primary);
        opacity: 0.05;
        animation: float 20s infinite ease-in-out;
      }

      .shape:nth-child(1) {
        width: 300px;
        height: 300px;
        top: 10%;
        right: 10%;
        animation-delay: 0s;
      }

      .shape:nth-child(2) {
        width: 200px;
        height: 200px;
        bottom: 20%;
        left: 15%;
        animation-delay: -7s;
        background: var(--gradient-accent);
      }

      .shape:nth-child(3) {
        width: 150px;
        height: 150px;
        top: 60%;
        right: 30%;
        animation-delay: -14s;
      }

      @keyframes float {
        0%,
        100% {
          transform: translateY(0) rotate(0deg) scale(1);
        }
        33% {
          transform: translateY(-30px) rotate(120deg) scale(1.1);
        }
        66% {
          transform: translateY(30px) rotate(240deg) scale(0.9);
        }
      }

      .container {
        position: relative;
        z-index: 10;
        max-width: 800px;
        margin: 0 auto;
        padding: 2rem;
        min-height: 100vh;
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
      }

      .main-card {
        background: rgba(255, 255, 255, 0.98);
        backdrop-filter: blur(20px);
        border: 1px solid rgba(255, 255, 255, 0.3);
        border-radius: 24px;
        padding: 3rem;
        box-shadow: 0 8px 32px rgba(79, 0, 114, 0.08),
          0 2px 8px rgba(0, 0, 0, 0.02);
        width: 100%;
        position: relative;
        overflow: hidden;
        transition: var(--transicao);
      }

      .main-card::before {
        content: "";
        position: absolute;
        top: 0;
        left: 0;
        right: 0;
        height: 4px;
        background: var(--gradient-accent);
        border-radius: 24px 24px 0 0;
      }

      .main-card:hover {
        transform: translateY(-3px);
        box-shadow: 0 12px 40px rgba(79, 0, 114, 0.12),
          0 4px 12px rgba(0, 0, 0, 0.04);
      }

      h1 {
        background: var(--gradient-primary);
        -webkit-background-clip: text;
        -webkit-text-fill-color: transparent;
        background-clip: text;
        font-size: 2.5rem;
        font-weight: 800;
        text-align: center;
        margin-bottom: 0.5rem;
        letter-spacing: -0.02em;
      }

      .subtitle {
        text-align: center;
        color: #4a5568;
        opacity: 0.9;
        font-size: 1.1rem;
        margin-bottom: 3rem;
        font-weight: 500;
      }

      .search-container {
        position: relative;
        margin-bottom: 2rem;
      }

      .search-icon {
        position: absolute;
        left: 1.5rem;
        top: 50%;
        transform: translateY(-50%);
        color: var(--primary-color);
        font-size: 1.2rem;
        z-index: 2;
      }

      #buscaIE {
        width: 100%;
        padding: 1.5rem 1.5rem 1.5rem 4rem;
        border: 2px solid #e2e8f0;
        border-radius: 16px;
        font-size: 1.1rem;
        background: #ffffff;
        color: #2d3748;
        transition: var(--transicao);
        font-family: inherit;
        outline: none;
      }

      #buscaIE:focus {
        border-color: var(--primary-color);
        box-shadow: 0 0 0 4px rgba(79, 0, 114, 0.08);
        background: white;
        transform: translateY(-1px);
      }

      #buscaIE::placeholder {
        color: rgba(100, 116, 139, 0.6);
      }

      #resultado {
        background: white;
        border-radius: 16px;
        padding: 2rem;
        border: 1px solid var(--border-color);
        min-height: 200px;
        display: flex;
        flex-direction: column;
        gap: 1rem;
        position: relative;
        overflow: hidden;
      }

      #resultado::before {
        content: "";
        position: absolute;
        top: 0;
        left: 0;
        right: 0;
        height: 3px;
        background: var(--gradient-accent);
      }

      .empty-state {
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: center;
        height: 150px;
        color: #4a5568;
        opacity: 0.9;
        font-size: 1.1rem;
        font-weight: 500;
      }

      .search-placeholder {
        font-size: 3rem;
        margin-bottom: 1rem;
        opacity: 0.3;
      }

      .item {
        background: linear-gradient(
          135deg,
          rgba(248, 250, 252, 0.8) 0%,
          rgba(241, 245, 249, 0.8) 100%
        );
        padding: 1.5rem;
        border-radius: 12px;
        border: 1px solid #e2e8f0;
        transition: var(--transicao);
        position: relative;
        overflow: hidden;
        animation: slideIn 0.5s ease-out forwards;
        opacity: 0;
        transform: translateY(20px);
      }

      .item::before {
        content: "";
        position: absolute;
        left: 0;
        top: 0;
        bottom: 0;
        width: 4px;
        background: var(--gradient-accent);
      }

      .item:hover {
        transform: translateY(-2px);
        box-shadow: 0 8px 25px rgba(79, 0, 114, 0.08);
        border-color: var(--primary-color);
        background: #ffffff;
      }

      @keyframes slideIn {
        to {
          opacity: 1;
          transform: translateY(0);
        }
      }

      .item-label {
        color: var(--primary-color);
        font-weight: 400;
        font-size: 0.9rem;
        text-transform: uppercase;
        letter-spacing: 0.05em;
        margin-bottom: 0.5rem;
      }

      .item-value {
        color: #2d3748;
        font-size: 1.1rem;
        line-height: 1.5;
        font-weight: 500;
      }

      .ie-value {
        font-family: "Monaco", "Consolas", monospace;
        background: rgba(248, 250, 252, 0.8);
        padding: 0.5rem 1rem;
        border-radius: 8px;
        display: inline-block;
        margin-top: 0.5rem;
        color: var(--primary-color);
        font-weight: 500;
        border: 1px solid #e2e8f0;
      }

      .not-found {
        text-align: center;
        color: var(--accent-color);
        font-size: 1.2rem;
        font-weight: 500;
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: center;
        height: 150px;
      }

      .not-found-icon {
        font-size: 3rem;
        margin-bottom: 1rem;
        opacity: 0.7;
      }

      .loading {
        display: flex;
        align-items: center;
        justify-content: center;
        height: 150px;
      }

      .spinner {
        width: 40px;
        height: 40px;
        border: 3px solid rgba(79, 0, 114, 0.2);
        border-top: 3px solid var(--primary-color);
        border-radius: 50%;
        animation: spin 1s linear infinite;
      }

      @keyframes spin {
        0% {
          transform: rotate(0deg);
        }
        100% {
          transform: rotate(360deg);
        }
      }

      /* Responsive Design */
      @media (max-width: 768px) {
        .container {
          padding: 1rem;
        }

        .main-card {
          padding: 2rem;
          border-radius: 20px;
        }

        h1 {
          font-size: 2rem;
        }

        .subtitle {
          font-size: 1rem;
          margin-bottom: 2rem;
        }

        #buscaIE {
          padding: 1.25rem 1.25rem 1.25rem 3.5rem;
          font-size: 1rem;
        }

        .search-icon {
          left: 1.25rem;
          font-size: 1.1rem;
        }
      }

      /* Dark mode support */
      @media (prefers-color-scheme: dark) {
        :root {
          --background-color: #1a1a1a;
          --form-bg-color: #2a2a2a;
          --text-color: #e0e0e0;
          --border-color: #3a3a3a;
          --glass-bg: rgba(26, 26, 26, 0.95);
        }
      }
    </style>

      let searchTimeout;

      function buscarLegislacao() {
        const inputIE = document.getElementById("buscaIE").value.trim();
        const resultadoDiv = document.getElementById("resultado");

        // Clear previous timeout
        clearTimeout(searchTimeout);

        // Show loading state
        if (inputIE !== "") {
          resultadoDiv.innerHTML =
            '<div class="loading"><div class="spinner"></div></div>';
        }

        // Debounce search
        searchTimeout = setTimeout(() => {
          performSearch(inputIE, resultadoDiv);
        }, 300);
      }

      function performSearch(inputIE, resultadoDiv) {
        resultadoDiv.innerHTML = "";

        if (inputIE === "") {
          resultadoDiv.innerHTML = `
                    <div class="empty-state">
                        <div class="search-placeholder">üìã</div>
                        <p>Digite uma Inscri√ß√£o Estadual para ver a legisla√ß√£o correspondente</p>
                    </div>
                `;
          return;
        }

        const encontrados = dadosLegislacao.filter((item) => {
          return (
            item.inscricao_estadual &&
            item.inscricao_estadual
              .toLowerCase()
              .includes(inputIE.toLowerCase())
          );
        });

        if (encontrados.length > 0) {
          encontrados.forEach((item, index) => {
            const divItem = document.createElement("div");
            divItem.classList.add("item");
            divItem.style.animationDelay = `${index * 0.1}s`;
            divItem.innerHTML = `
                        <div class="item-label">Inscri√ß√£o Estadual</div>
                        <div class="item-value">
                            <span class="ie-value">${item.inscricao_estadual}</span>
                        </div>
                        <div class="item-label" style="margin-top: 1rem;">Legisla√ß√£o</div>
                        <div class="item-value">${item.legislacao}</div>
                    `;
            resultadoDiv.appendChild(divItem);
          });
        } else {
          resultadoDiv.innerHTML = `
                    <div class="not-found">
                        <div class="not-found-icon">‚ùå</div>
                        <p>Nenhuma legisla√ß√£o encontrada para esta Inscri√ß√£o Estadual</p>
                    </div>
                `;
        }
      }

      // Add some interactive enhancements
      document.getElementById("buscaIE").addEventListener("focus", function () {
        this.parentElement.style.transform = "scale(1.02)";
      });

      document.getElementById("buscaIE").addEventListener("blur", function () {
        this.parentElement.style.transform = "scale(1)";
      });

      // Add keyboard shortcuts
      document.addEventListener("keydown", function (e) {
        if ((e.ctrlKey || e.metaKey) && e.key === "k") {
          e.preventDefault();
          document.getElementById("buscaIE").focus();
        }
      });
    </script>
